import './ExpenseItem.css';
function ExpenseItem() {
    return (
        <div className="expense-item">
            <div>1st June 2021</div>
                <div>
                    <h2 className="expense-item__description">Laptop</h2>
                    <div className="expense-item__price">985</div>
                </div>
        </div>
    ) 
};

export default ExpenseItem;
